m,\\n                data.email,\\n                data.user_level,\\n                data.birthday,\\n                data.gender,\\n                data.create_time,\\n                data.operate_time,\\n                row_number() over (partition by data.id order by ts desc) rn\\n            from gmall.ods_user_info_inc\\n            where dt=${do_date}\\n        )t1\\n        where rn=1\\n    )t2\\n)t3\",\"udfs\":\"\",\"sqlType\":\"1\",\"sendEmail\":false,\"displayRows\":10,\"title\":\"\",\"groupId\":null,\"localParams\":[],\"connParams\":\"\",\"preStatements\":[],\"postStatements\":[],\"dependence\":{},\"conditionResult\":{\"successNode\":[],\"failedNode\":[]},\"waitStartTimeout\":{},\"switchResult\":{}}',1,2,'default',8490412510240,0,1,0,0,0,0,'','2023-04-14 14:47:08','2023-04-14 15:02:22'),(12,9219126762274,'dim_sku_full',3,'',9219125297696,2,'SQL','{\"type\":\"HIVE\",\"datasource\":1,\"sql\":\"with\\nsku as\\n(\\n    select\\n        id,\\n        price,\\n        sku_name,\\n        sku_desc,\\n        weight,\\n        is_sale,\\n        spu_id,\\n        category3_id,\\n        tm_id,\\n        create_time\\n    from gmall.ods_sku_info_full\\n    where dt=${do_date}\\n),\\nspu as\\n(\\n    select\\n        id,\\n        spu_name\\n    from gmall.ods_spu_info_full\\n    where dt=${do_date}\\n),\\nc3 as\\n(\\n    select\\n        id,\\n        name,\\n        category2_id\\n    from gmall.ods_base_category3_full\\n    where dt=${do_date}\\n),\\nc2 as\\n(\\n    select\\n        id,\\n        name,\\n        category1_id\\n    from gmall.ods_base_category2_full\\n    where dt=${do_date}\\n),\\nc1 as\\n(\\n    select\\n        id,\\n        name\\n    from gmall.ods_base_category1_full\\n    where dt=${do_date}\\n),\\ntm as\\n(\\n    select\\n        id,\\n        tm_name\\n    from gmall.ods_base_trademark_full\\n    where dt=${do_date}\\n),\\nattr as\\n(\\n    select\\n        sku_id,\\n        collect_set(named_struct(\'attr_id\',attr_id,\'value_id\',valu