me,\\n        category1_id,\\n        category1_name,\\n        category2_id,\\n        category2_name,\\n        category3_id,\\n        category3_name,\\n        cart_num,\\n        rank() over (partition by category1_id,category2_id,category3_id order by cart_num desc) rk\\n    from\\n    (\\n        select\\n            sku_id,\\n            sum(sku_num) cart_num\\n        from gmall.dwd_trade_cart_full\\n        where dt=${do_date}\\n        group by sku_id\\n    )cart\\n    left join\\n    (\\n        select\\n            id,\\n            sku_name,\\n            category1_id,\\n            category1_name,\\n            category2_id,\\n            category2_name,\\n            category3_id,\\n            category3_name\\n        from gmall.dim_sku_full\\n        where dt=${do_date}\\n    )sku\\n    on cart.sku_id=sku.id\\n)t1\\nwhere rk<=3\",\"udfs\":\"\",\"sqlType\":\"1\",\"sendEmail\":false,\"displayRows\":10,\"title\":\"\",\"groupId\":null,\"localParams\":[],\"connParams\":\"\",\"preStatements\":[],\"postStatements\":[],\"dependence\":{},\"conditionResult\":{\"successNode\":[],\"failedNode\":[]},\"waitStartTimeout\":{},\"switchResult\":{}}',1,2,'default',8490412510240,0,1,0,0,0,0,'','2023-04-14 14:47:08','2023-04-14 15:02:22'),(49,9219126762787,'ads_sku_favor_count_top3_by_tm',3,'',9219125297696,2,'SQL','{\"type\":\"HIVE\",\"datasource\":1,\"sql\":\"insert overwrite table gmall.ads_sku_favor_count_top3_by_tm\\nselect * from gmall.ads_sku_favor_count_top3_by_tm\\nunion\\nselect\\n    ${do_date} dt,\\n    tm_id,\\n    tm_name,\\n    sku_id,\\n    sku_name,\\n    favor_add_count_1d,\\n    rk\\nfrom\\n(\\n    select\\n        tm_id,\\n        tm_name,\\n        sku_id,\\n        sku_name,\\n        favor_add_count_1d,\\n        rank() over (partition by tm_id order by favor_add_count_1d desc) rk\\n    from gmall.dws_interaction_sku_favor_add_1d\\n    where dt=${do_date}\\n)t1\\nwhere rk<=3\",\"udfs\":\"\",\"sqlType\":\"1\",\"sendEmail\":false,\"displayRows\":10,\"title\":\"\",\"groupId\":null,\"localParams\":[],\"connParams\":\"\",\"preStatements\":[],\"postStatements\":[],\"dependence\":{},\"conditionResult\":{\"successNode\":[],\"failedNode\":[]},\"waitStartTimeout\":{},\"switchResult\":{}}',1,2,'default',8490412510240,0,1,0,0,0,0,'','2023-04-14 14:47:08','2023-04-14 15:02:22'),(50,9219126762788,'ads_traffic_stats_by_channel',3,'',9219125297696,2,'SQL','{\"type\":\"HIVE\",\"datasource\":1,\"sql\":\"insert overwrite table gmall.ads_traffic_stats_by_channel\\nselect * from gmall.ads_traffic_stats_by_channel\\nunion\\nselect\\n    ${do_date} dt,\\n    recent_days,\\n    channel,\\n    cast(count(distinct(mid_id)) as bigint) uv_count,\\n    cast(avg(during_time_1d)/1000 as bigint) avg_duration_sec,\\n    cast(avg(page_count_1d) as bigint) avg_page_count,\\n    cast(count(*) as bigint) sv_count,\\n    cast(sum(if(page_count_1d=1,1,0))/count(*) as decimal(16,2)) bounce_rate\\nfrom gmall.dws_traffic_session_page_view_1d lateral view explode(array(1,7,30)) tmp as recent_days\\nwhere dt>=date_add(${do_date},-recent_days+1)\\ngroup by recent_days,channel\",\"udfs\":\"\",\"sqlType\":\"1\",\"sendEmail\":false,\"displayRows\":10,\"title\":\"\",\"groupId\":null,\"localParams\":[],\"connParams\":\"\",\"preStatements\":[],\"postStatements\":[],\"dependence\":{},\"conditionResult\":{\"successNode\":[],\"failedNode\":[]},\"waitStartTimeout\":{},\"switchResult\":{}}',1,2,'default',8490412510240,0,1,0,0,0,0,'','2023-04-14 14:47:08','2023-04-14 15:02:22'),(51,9219126762789,'ads_user_action',3,'',9219125297696,2,'SQL','{\"type\":\"HIVE\",\"datasource\":1,\"sql\":\"insert overwrite table gmall.ads_user_action\\nselect * from gmall.ads_user_action\\nunion\\nselect\\n    ${do_date} dt,\\n    home_count,\\n    good_detail_count,\\n    cart_count,\\n    order_count,\\n    payment_count\\nfrom\\n(\\n    select\\n        1 recent_days,\\n        sum(if(page_id=\'home\',1,0)) home_count,\\n        sum(if(page_id=\'good_detail\',1,0)) good_detail_count\\n    from gmall.dws_traffic_page_visitor_page_view_1d\\n    where dt=${do_date}\\n    and page_id in (\'home\',\'good_detail\')\\n)page\\njoin\\n(\\n    select\\n        1 recent_days,\\n        count(*) cart_count\\n    from gmall.dws_trade_user_cart_add_1d\\n    where dt=${do_date}\\n)cart\\non page.recent_days=cart.recent_days\\njoin\\n(\\n    select\\n        1 recent_days,\\n        count(*) order_count\\n    from gmall.dws_trade_user_order_1d\\n    where dt=${do_date}\\n)ord\\non page.recent_days=ord.recent_days\\njoin\\n(\\n    select\\n        1 recent_days,\\n        count(*) payment_count\\n    from gmall.dws_trade_user_payment_1d\\n    where dt=${do_date}\\n)pay\\non page.recent_days=pay.recent_days\",\"udfs\":\"\",\"sqlType\":\"1\",\"sendEmail\":false,\"displayRows\":10,\"title\":\"\",\"groupId\":null,\"localParams\":[],\"connParams\":\"\",\"preStatements\":[],\"postStatements\":[],\"dependence\":{},\"conditionResult\":{\"successNode\":[],\"failedNode\":[]},\"waitStartTimeout\":{},\"switchResult\":{}}',1,2,'default',8490412510240,0,1,0,0,0,0,'','2023-04-14 14:47:08','2023-04-14 15:02:22'),(52,9219126762912,'ads_user_change',3,'',9219125297696,2,'SQL','{\"type\":\"HIVE\",\"datasource\":1,\"sql\":\"insert overwrite table gmall.ads_user_change\\nselect * from gmall.ads_user_change\\nunion\\nselect\\n    churn.dt,\\n    user_churn_count,\\n    user_back_count\\nfrom\\n(\\n    select\\n        ${do_date} dt,\\n        count(*) user_churn_count\\n    from gmall.dws_user_user_login_td\\n    where dt=${do_date}\\n    and login_date_last=date_add(${do_date},-7)\\n)churn\\njoin\\n(\\n    select\\n        ${do_date} dt,\\n        count(*) user_back_count\\n    from\\n    (\\n        select\\n            user_id,\\n            login_date_last\\n        from gmall.dws_user_user_login_td\\n        where dt=${do_date}\\n    )t1\\n    join\\n    (\\n        select\\n            user_id,\\n            login_date_last login_date_previous\\n        from gmall.dws_user_user_login_td\\n        where dt=date_add(${do_date},-1)\\n    )t2\\n    on t1.user_id=t2.user_id\\n    where datediff(login_date_last,login_date_previous)>=8\\n)back\\non churn.dt=back.dt\",\"udfs\":\"\",\"sqlType\":\"1\",\"sendEmail\":false,\"displayRows\":10,\"title\":\"\",\"groupId\":null,\"localParams\":[],\"connParams\":\"\",\"preStatements\":[],\"postStatements\":[],\"dependence\":{},\"conditionResult\":{\"successNode\":[],\"failedNode\":[]},\"waitStartTimeout\":{},\"switchResult\":{}}',1,2,'default',8490412510240,0,1,0,0,0,0,'','2023-04-14 14:47:08','2023-04-14 15:02:22'),(53,9219126762913,'ads_user_retention',3,'',9219125297696,2,'SQL','{\"type\":\"HIVE\",\"datasource\":1,\"sql\":\"insert overwrite table gmall.ads_user_retention\\nselect * from gmall.ads_user_retention\\nunion\\nselect\\n    ${do_date} dt,\\n    login_date_first create_date,\\n    datediff(${do_date},login_date_first) retention_day,\\n    sum(if(login_date_last=${do_date},1,0)) retention_count,\\n    count(*) new_user_count,\\n    cast(sum(if(login_date_last=${do_date},1,0))/count(*)*100 as decimal(16,2)) retention_rate\\nfrom\\n(\\n    select\\n        user_id,\\n        date_id login_date_first\\n    from gmall.dwd_user_register_inc\\n    where dt>=date_add(${do_date},-7)\\n    and dt<${do_date}\\n)t1\\njoin\\n(\\n    select\\n        user_id,\\n        login_date_last\\n    from gmall.dws_user_user_login_td\\n    where dt=${do_date}\\n)t2\\non t1.user_id=t2.user_id\\ngroup by login_date_first\",\"udfs\":\"\",\"sqlType\":\"1\",\"sendEmail\":false,\"displayRows\":10,\"title\":\"\",\"groupId\":null,\"localParams\":[],\"connParams\":\"\",\"preStatements\":[],\"postStatements\":[],\"dependence\":{},\"conditionResult\":{\"successNode\":[],\"failedNode\":[]},\"waitStartTimeout\":{},\"switchResult\":{}}',1,2,'default',8490412510240,0,1,0,0,0,0,'','2023-04-14 14:47:08','2023-04-14 15:02:22'),(54,9219126762914,'ads_user_stats',3,'',9219125297696,2,'SQL','{\"type\":\"HIVE\",\"datasource\":1,\"sql\":\"insert overwrite table gmall.ads_user_stats\\nselect * from gmall.ads_user_stats\\nunion\\nselect\\n    ${do_date} dt,\\n    t1.recent_days,\\n    new_user_count,\\n    active_user_count\\nfrom\\n(\\n    select\\n        recent_days,\\n        sum(if(login_date_last>=date_add(${do_date},-recent_days+1),1,0)) new_user_count\\n    from gmall.dws_user_user_login_td lateral view explode(array(1,7,30)) tmp as recent_days\\n    where dt=${do_date}\\n    group by recent_days\\n)t1\\njoin\\n(\\n    select\\n        recent_days,\\n        sum(if(date_id>=date_add(${do_date},-recent_days+1),1,0)) active_user_count\\n    from gmall.dwd_user_register_inc lateral view explode(array(1,7,30)) tmp as recent_days\\n    group by recent_days\\n)t2\\non t1.recent_days=t2.recent_days\",\"udfs\":\"\",\"sqlType\":\"1\",\"sendEmail\":false,\"displayRows\":10,\"title\":\"\",\"groupId\":null,\"localParams\":[],\"connParams\":\"\",\"preStatements\":[],\"postStatements\":[],\"dependence\":{},\"conditionResult\":{\"successNode\":[],\"failedNode\":[]},\"waitStartTimeout\":{},\"switchResult\":{}}',1,2,'default',8490412510240,0,1,0,0,0,0,'','2023-04-14 14:47:08','2023-04-14 15:02:22'),(55,9219126762915,'dim_province_full',3,'',9219125297696,2,'SQL','{\"type\":\"HIVE\",\"datasource\":1,\"sql\":\"insert overwrite table gmall.dim_province_full partition(dt=${do_date})\\nselect\\n    province.id,\\n    province.name,\\n    province.area_code,\\n    province.iso_code,\\n    province.iso_3166_2,\\n    region_id,\\n    region_name\\nfrom\\n(\\n    select\\n        id,\\n        name,\\n        region_id,\\n        area_code,\\n        iso_code,\\n        iso_3166_2\\n    from gmall.ods_base_province_full\\n    where dt=${do_date}\\n)province\\nleft join\\n(\\n    select\\n        id,\\n        region_name\\n    from gmall.ods_base_region_full\\n    where dt=${do_date}\\n)region\\non province.region_id=region.id\",\"udfs\":\"\",\"sqlType\":\"1\",\"sendEmail\":false,\"displayRows\":10,\"title\":\"\",\"groupId\":null,\"localParams\":[],\"connParams\":\"\",\"preStatements\":[],\"postStatements\":[],\"dependence\":{},\"conditionResult\":{\"successNode\":[],\"failedNode\":[]},\"waitStartTimeout\":{},\"switchResult\":{}}',1,2,'default',8490412510240,0,1,0,0,0,0,'','2023-04-14 14:47:08','2023-04-14 15:02:22'),(56,9219126762916,'dws_trade_user_order_1d_import_20230414144707836',1,'',9219125297696,2,'SQL','{\"type\":\"HIVE\",\"datasource\":2,\"sql\":\"insert overwrite table gmall.dws_trade_user_order_1d partition(dt=${do_date})\\nselect\\n    user_id,\\n    count(distinct(order_id)),\\n    sum(sku_num),\\n    sum(split_original_amount),\\n    sum(nvl(split_activity_amount,0)),\\n    sum(nvl(split_coupon_amount,0)),\\n    sum(split_total_amount)\\nfrom gmall.dwd_trade_order_detail_inc\\nwhere dt=${do_date}\\ngroup by user_id\",\"udfs\":\"\",\"sqlType\":\"1\",\"sendEmail\":false,\"displayRows\":10,\"title\":\"\",\"groupId\":null,\"localParams\":[],\"connParams\":\"\",\"preStatements\":[],\"postStatements\":[],\"dependence\":{},\"conditionResult\":{\"successNode\":[],\"failedNode\":[]},\"waitStartTimeout\":{},\"switchResult\":{}}',1,2,'default',8490412510240,0,1,0,NULL,0,0,'','2023-04-14 14:47:08','2023-04-14 14:47:08'),(57,9219126762917,'dws_trade_user_cart_add_1d',3,'',9219125297696,2,'SQL','{\"type\":\"HIVE\",\"datasource\":1,\"sql\":\"insert overwrite table gmall.dws_trade_user_cart_add_1d partition(dt=${do_date})\\nselect\\n    user_id,\\n    count(*),\\n    sum(sku_num)\\nfrom gmall.dwd_trade_cart_add_inc\\nwhere dt=${do_date}\\ngroup by user_id\",\"udfs\":\"\",\"sqlType\":\"1\",\"sendEmail\":false,\"displayRows\":10,\"title\":\"\",\"groupId\":null,\"localParams\":[],\"connParams\":\"\",\"preStatements\":[],\"postStatements\":[],\"dependence\":{},\"conditionResult\":{\"successNode\":[],\"failedNode\":[]},\"waitStartTimeout\":{},\"switchResult\":{}}',1,2,'default',8490412510240,0,1,0,0,0,0,'','2023-04-14 14:47:08','2023-04-14 15:02:22'),(58,9219126762918,'dws_trade_user