  end_date,\\n        row_number() over (partition by id order by start_date desc) rn\\n    from\\n    (\\n        select\\n            id,\\n            login_name,\\n            nick_name,\\n            name,\\n            phone_num,\\n            email,\\n            user_level,\\n            birthday,\\n            gender,\\n            create_time,\\n            operate_time,\\n            start_date,\\n            end_date\\n        from gmall.dim_user_zip\\n        where dt=\'9999-12-31\'\\n        union\\n        select\\n            id,\\n            login_name,\\n            nick_name,\\n            md5(name) name,\\n            md5(if(phone_num regexp \'^(13[0-9]|14[01456879]|15[0-35-9]|16[2567]|17[0-8]|18[0-9]|19[0-35-9])\\\\\\\\\\\\d{8}$\',phone_num,null)) phone_num,\\n            md5(if(email regexp \'^[a-zA-Z0-9_-]+@[a-zA-Z0-9_-]+(\\\\\\\\\\\\.[a-zA-Z0-9_-]+)+$\',email,null)) email,\\n            user_level,\\n            birthday,\\n            gender,\\n            create_time,\\n            operate_time,\\n            \'${do_date}\' start_date,\\n            \'9999-12-31\' end_date\\n        from\\n        (\\n            select\\n                data.id,\\n                data.login_name,\\n                data.nick_name,\\n                data.name,\\n                data.phone_num,\\n                data.email,\\n                data.user_level,\\n                data.birthday,\\n                data.gender,\\n                data.create_time,\\n                data.operate_time,\\n                row_number() over (partition by data.id order by ts desc) rn\\n            from gmall.ods_user_info_inc\\n            where dt=\'${do_date}\'\\n        )t1\\n        where rn=1\\n    )t2\\n)t3;\\n\\\"\\nhive -e \\\"$sql\\\"\",\"dependence\":{},\"conditionResult\":{\"successNode\":[],\"failedNode\":[]},\"waitStartTimeout\":{},\"switchResult\":{}}',1,2,'default',8490412510240,3,1,1,0,2,0,'','2023-04-25 11:13:15','2023-04-25 19:49:10'),(66,9338394718880,'