te}\'\\n),\\nc2 as\\n(\\n    select\\n        id,\\n        name,\\n        category1_id\\n    from gmall.ods_base_category2_full\\n    where dt=\'${do_date}\'\\n),\\nc1 as\\n(\\n    select\\n        id,\\n        name\\n    from gmall.ods_base_category1_full\\n    where dt=\'${do_date}\'\\n),\\ntm as\\n(\\n    select\\n        id,\\n        tm_name\\n    from gmall.ods_base_trademark_full\\n    where dt=\'${do_date}\'\\n),\\nattr as\\n(\\n    select\\n        sku_id,\\n        collect_set(named_struct(\'attr_id\',attr_id,\'value_id\',value_id,\'attr_name\',attr_name,\'value_name\',value_name)) attrs\\n    from gmall.ods_sku_attr_value_full\\n    where dt=\'${do_date}\'\\n    group by sku_id\\n),\\nsale_attr as\\n(\\n    select\\n        sku_id,\\n        collect_set(named_struct(\'sale_attr_id\',sale_attr_id,\'sale_attr_value_id\',sale_attr_value_id,\'sale_attr_name\',sale_attr_name,\'sale_attr_value_name\',sale_attr_value_name)) sale_attrs\\n    from gmall.ods_sku_sale_attr_value_full\\n    where dt=\'${do_date}\'\\n    group by sku_id\\n)\\ninsert overwrite table gmall.dim_sku_full partition(dt=\'${do_date}\')\\nselect\\n    sku.id,\\n    sku.price,\\n    sku.sku_name,\\n    sku.sku_desc,\\n    sku.weight,\\n    sku.is_sale,\\n    sku.spu_id,\\n    spu.spu_name,\\n    sku.category3_id,\\n    c3.name,\\n    c3.category2_id,\\n    c2.name,\\n    c2.category1_id,\\n    c1.name,\\n    sku.tm_id,\\n    tm.tm_name,\\n    attr.attrs,\\n    sale_attr.sale_attrs,\\n    sku.create_time\\nfrom sku\\nleft join spu on sku.spu_id=spu.id\\nleft join c3 on sku.category3_id=c3.id\\nleft join c2 on c3.category2_id=c2.id\\nleft join c1 on c2.category1_id=c1.id\\nleft join tm on sku.tm_id=tm.id\\nleft join attr on sku.id=attr.sku_id\\nleft join sale_attr on sku.id=sale_attr.sku_id;\\n\\\"\\nhive -e \\\"$sql\\\"\",\"dependence\":{},\"conditionResult\":{\"successNode\":[],\"failedNode\":[]},\"waitStartTimeout\":{},\"switchResult\":{}}',1,2,'default',8490412510240,0,1,0,0,0,0,'','2023-